You can use JavaScript's built-in `Object.keys()` method, which returns an array of an object's own property names, then sort them using the `Array.sort()` method, and finally map over them to create a new object with the keys in alphabetical order.

Here is how you would do it:

```javascript
let dictionary = {
    "banana": 2,
    "apple": 4,
    "orange": 3,
    "grapes": 5
};

let sortedDictionary = {};

Object.keys(dictionary).sort().forEach(function(key) {
    sortedDictionary[key] = dictionary[key];
});

console.log(sortedDictionary);
```

Output:

```javascript
{
    "apple": 4,
    "banana": 2,
    "grapes": 5,
    "orange": 3
}
```

This script first gets all the keys from `dictionary` and sorts them in alphabetical order. It then loops through each sorted key, adding it to `sortedDictionary` with its corresponding value from the original dictionary. The result is a new dictionary with keys in alphabetical order.
